import React from 'react';

const DeliveryBy = ({ vendor }) => {
  if (!vendor) return null; // Render nothing if vendor data is unavailable

  return (
    <div className="text-center mt-3">
      <p className="mb-1 text-muted" style={{ fontSize: '0.9rem' }}>Delivered by</p>
      <div className="d-flex align-items-center justify-content-center">
        {/* Vendor Logo */}
        <img
          src={vendor.logoUrl || '/placeholder-logo.png'}
          alt={vendor.dispensaryName}
          className="rounded-circle"
          style={{
            width: '30px',
            height: '30px',
            objectFit: 'cover',
            marginRight: '8px',
          }}
        />
        {/* Dispensary Name */}
        <span className="text-muted" style={{ fontSize: '0.9rem' }}>
          | {vendor.dispensaryName}
        </span>
      </div>
    </div>
  );
};

export default DeliveryBy;
